import React from "react";
import { motion } from "framer-motion";
import Spline from "@splinetool/react-spline";
import "../styles/Home.css";

function Home() {
  return (
    <div className="home-container">
      <section className="hero py-20 px-6 text-center">
        <motion.div
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
        >
          <h1 className="text-5xl font-bold">Explore the World with Us</h1>
          <p className="text-lg mt-4 text-gray-600">
            Your next adventure starts here. Discover stunning destinations with curated tours.
          </p>
        </motion.div>
        <div className="spline-wrapper mt-10 max-w-4xl mx-auto">
        <Spline scene="https://prod.spline.design/NZDLX1zUOsxkmZ0y/scene.splinecode" />

        </div>
      </section>

      <section className="features grid grid-cols-1 md:grid-cols-3 gap-8 p-10">
        <motion.div className="feature" whileHover={{ scale: 1.05 }}>
          <h3 className="text-xl font-semibold mb-2">Custom Tours</h3>
          <p>Create your own itinerary with flexible dates and destinations.</p>
        </motion.div>
        <motion.div className="feature" whileHover={{ scale: 1.05 }}>
          <h3 className="text-xl font-semibold mb-2">Local Guides</h3>
          <p>Explore like a local with our expert tour leaders.</p>
        </motion.div>
        <motion.div className="feature" whileHover={{ scale: 1.05 }}>
          <h3 className="text-xl font-semibold mb-2">Best Prices</h3>
          <p>We offer unbeatable prices for unforgettable experiences.</p>
        </motion.div>
      </section>
    </div>
  );
}

export default Home;
